nu-item\"><div class=\"gsc-option\">Date</div></div></div></div></div></td></tr></tbody></table></div><div class=\"gsc-adBlockInvisible\"></div><div class=\"gsc-wrapper\"><div class=\"gsc-adBlockInvisible\"></div><div class=\"gsc-resultsbox-invisible\"><div class=\"gsc-resultsRoot gsc-tabData gsc-tabdActive\"><table cellspacing=\"0\" cellpadding=\"0\" class=\"gsc-resultsHeader\"><tbody><tr><td class=\"gsc-twiddleRegionCell\"><div class=\"gsc-twiddle\"><div class=\"gsc-title\">Web</div></div><div class=\"gsc-stats\"></div><div class=\"gsc-results-selector gsc-all-results-active\"><div class=\"gsc-result-selector gsc-one-result\" title=\"show one result\">&nbsp;</div><div class=\"gsc-result-selector gsc-more-results\" title=\"show more results\">&nbsp;</div><div class=\"gsc-result-selector gsc-all-results\" title=\"show all results\">&nbsp;</div></div></td><td class=\"gsc-configLabelCell\"></td></tr></tbody></table><div><div class=\"gsc-expansionArea\"></div></div></div></div></div></div><div class=\"gsc-modal-background-image\" tabindex=\"0\"></div></div></div></div></div>","        "],"id":57}],[{"start":{"row":64,"column":11},"end":{"row":69,"column":0},"action":"remove","lines":["The studio founded by Daniel Kuzuhara began in July of 2016, where he began teaching private piano and violin lessons. The name Appassionato Music Studio was given in 2017 to better symbolize the core values of the studio. “Appassionato” is the Italian word for passionate. This word demonstrates the studio’s desire to create passion and emotion within the students’ music. The studio strives for the right balance between enjoyment of the art and maintaining a high level of playing from the students. Appassionato Music Studio constantly invites challenges and sets high yet reasonable goals for students to maximize the amount of progress, reward, and satisfaction that comes with the journey of learning music.</p>","        ","\t\t<p>Appassionato Music Studio currently contains over 20 students ranging from age 5 to 13. Students of Appassionato Music Studio have shown great achievement throughout the studio’s two years. In addition to the strong performances they demonstrate in their studio recitals, they also attend multiple other events and have received recognition for their hard work. Students have received top marks in the National Federation of Music Clubs (NFMC) Junior Festival. In addition, students hold a 100% pass rate in the Associated Board of the Royal School of Music (ABRSM) exams, while multiple students received merit (honors) and one received distinction (top honors). Two students have competed in Rhapsody Arts Center’s Sonatina Festival, with both students winning trophies in their respective categories. Most notably, four students recently entered the 2018 Steinway Piano Competition in Madison, with one of them winning first place in the Division I category, a performance in the winner’s recital, and national recognition on the Steinway website. </p>","","\t\t<p>Appassionato Music Studio currently offers private piano lessons, violin lessons, ABRSM theory tutoring, accompanying services, and his own services as a performer for any concerts/events. The studio’s services are open to children and adults of all ages. Students of all experience levels are welcome, including beginners. </p>",""],"id":58},{"start":{"row":64,"column":11},"end":{"row":68,"column":124},"action":"insert","lines":["Welcome to the Appassionato Music Studio website page. Appassionato Music Studio is a music studio based in Madison, WI that offers multiple services, primarily private lessons for piano and violin. Other services offered include theory tutoring, piano accompanying services, and piano performer for hire at various events.","","Events, lesson information, and sound/video samples can be found on this website. You may also check out our Instagram page and YouTube channel (click icons at the bottom of the page) for more photos and videos from various events.","","Feel free to contact me with any questions or inquiries at dckuzuhara.appassionato@gmail.com or via phone at (608) 209-0088."]}],[{"start":{"row":66,"column":0},"end":{"row":66,"column":11},"action":"insert","lines":["        <p>"],"id":59}],[{"start":{"row":68,"column":0},"end":{"row":68,"column":11},"action":"insert","lines":["        <p>"],"id":60}],[{"start":{"row":68,"column":70},"end":{"row":68,"column":71},"action":"insert","lines":["<"],"id":61},{"start":{"row":68,"column":71},"end":{"row":68,"column":72},"action":"insert","lines":["a"]}],[{"start":{"row":68,"column":72},"end":{"row":68,"column":73},"action":"insert","lines":[" "],"id":62},{"start":{"row":68,"column":73},"end":{"row":68,"column":74},"action":"insert","lines":["h"]},{"start":{"row":68,"column":74},"end":{"row":68,"column":75},"action":"insert","lines":["r"]},{"start":{"row":68,"column":75},"end":{"row":68,"column":76},"action":"insert","lines":["e"]},{"start":{"row":68,"column":76},"end":{"row":68,"column":77},"action":"insert","lines":["f"]},{"start":{"row":68,"column":77},"end":{"row":68,"column":78},"action":"insert","lines":["="]},{"start":{"row":68,"column":78},"end":{"row":68,"column":79},"action":"insert","lines":["\""]},{"start":{"row":68,"column":79},"end":{"row":68,"column":80},"action":"insert","lines":["\""]}],[{"start":{"row":68,"column":79},"end":{"row":68,"column":80},"action":"insert","lines":["m"],"id":63},{"start":{"row":68,"column":80},"end":{"row":68,"column":81},"action":"insert","lines":["a"]},{"start":{"row":68,"column":81},"end":{"row":68,"column":82},"action":"insert","lines":["i"]},{"start":{"row":68,"column":82},"end":{"row":68,"column":83},"action":"insert","lines":["l"]},{"start":{"row":68,"column":83},"end":{"row":68,"column":84},"action":"insert","lines":["t"]},{"start":{"row":68,"column":84},"end":{"row":68,"column":85},"action":"insert","lines":["o"]},{"start":{"row":68,"column":85},"end":{"row":68,"column":86},"action":"insert","lines":[":"]}],[{"star